import request from '@/utils/request';
export default {
  getList: function getList(params) {
    return request({
      url: '/shop/order/list',
      method: 'get',
      params: params
    });
  },
  getOrderStatistic: function getOrderStatistic() {
    return request({
      url: '/shop/order/getOrderStatistic',
      method: 'get'
    });
  },
  exportXls: function exportXls(params) {
    return request({
      url: '/shop/order/export',
      method: 'get',
      params: params
    });
  },
  sendOut: function sendOut(id, idExpress, shippingSn) {
    return request({
      url: '/shop/order/sendOut/' + id,
      method: 'post',
      params: {
        idExpress: idExpress,
        shippingSn: shippingSn
      }
    });
  },
  remove: function remove(id) {
    return request({
      url: '/shop/order',
      method: 'delete',
      params: {
        id: id
      }
    });
  },
  getOrder: function getOrder(orderSn) {
    return request({
      url: '/shop/order/' + orderSn,
      method: 'get'
    });
  },
  getLogs: function getLogs(idOrder) {
    return request({
      url: '/shop/order/log/queryByIdOrder/' + idOrder,
      method: 'get'
    });
  },
  addComment: function addComment(idOrder, message) {
    return request({
      url: '/shop/order/comment/' + idOrder,
      method: 'post',
      params: {
        message: message
      }
    });
  },
  getExpressInfo: function getExpressInfo(orderSn) {
    return request({
      url: '/shop/order/getExpressInfo/' + orderSn,
      method: 'get'
    });
  }
};
